import { Route, Routes } from 'react-router-dom';
import './App.css';
import Login from './pages/Login';
import Signup from './pages/Signup'

function App() {
  return (
    <div className="App">
    <Login/>
    <Signup/>
    <Routes>
      <Route path='/' element={<Login/>} />

    </Routes>
    </div>
  );
}

export default App;
